package com.ssm.beans;

import java.io.Serializable;

public class ProbeDefaultBean implements Serializable {
	
	private String id;
	private String surveyName;
	private String unit;
	private Integer surveyMax;
	private Integer surveyMin;
	private String imgUrl;
	
	
	public ProbeDefaultBean() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getSurveyName() {
		return surveyName;
	}
	public void setSurveyName(String surveyName) {
		this.surveyName = surveyName;
	}
	public String getUnit() {
		return unit;
	}
	public void setUnit(String unit) {
		this.unit = unit;
	}
	public Integer getSurveyMax() {
		return surveyMax;
	}
	public void setSurveyMax(Integer surveyMax) {
		this.surveyMax = surveyMax;
	}
	public Integer getSurveyMin() {
		return surveyMin;
	}
	public void setSurveyMin(Integer surveyMin) {
		this.surveyMin = surveyMin;
	}
	public String getImgUrl() {
		return imgUrl;
	}
	public void setImgUrl(String imgUrl) {
		this.imgUrl = imgUrl;
	}
	@Override
	public String toString() {
		return "ProbeDefaultBean [id=" + id + ", surveyName=" + surveyName
				+ ", unit=" + unit + ", surveyMax=" + surveyMax
				+ ", surveyMin=" + surveyMin + ", imgUrl=" + imgUrl + "]";
	}
	
}

